import { createBrowserRouter, RouterProvider, Route } from 'react-router-dom';

const router = createBrowserRouter([
{
 path: "/", 
 element: <App></App>
},
{
  path:"BlogPlantes",
  element: <Blo></Blo>,
}
])

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <div>
      <p>Bienvenue sur PlantaPlante !</p>
